import React from "react"

const styles = {
    body__buttonFilter: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },

    button: {
        outline: 'none',
    },
};

export default function TodoFilter(props) {
    return (
        <div style={styles.body__buttonFilter}>
            <button></button>
            <button></button>
            <button></button>
        </div>
    )
}
